import React from "react";
import "./ProductReviewDisplay.css";

function ProductReviewDisplay() {
  return (
    <div>
      <br />
      <div className="product-reviewDisplay-container">
        <div className="reviewDisplay-header">
          <h3>Aslam Youseph</h3>
        </div>
        <p className="reviewDisplay-text">
          It’s a good and interesting laptop I have ever seen.
        </p>
      </div>
      <div className="product-reviewDisplay-container">
        <div className="reviewDisplay-header">
          <h3>Aslam Youseph</h3>
        </div>
        <p className="reviewDisplay-text">
          It’s a good and interesting laptop I have ever seen.
        </p>
      </div>
    </div>
  );
}

export default ProductReviewDisplay;
